  true,\n\t\"url\": null,\n\t\"notes\": \"<p>HRSA's Bureau of Primary Health Care's
  Uniform Data System (UDS) tracks a variety of information, including patient demographics,
  services provided, clinical indicators and utilization rates. UDS data are collected
  from HRSA health centers and reported at the grantee, state, and national levels.
  The data are used to improve health center performance and operations and to report
  overall program accomplishments. The Uniform Data System (UDS) provides annual data
  snapshots, demographic trends, and data comparison tools which allow for state-to-state
  and state-to-national comparisons. Data is presented in a variety of tables and
  charts, and can be exported into Excel to facilitate public use.</p>n\",\n\t\"license_title\":
